var canvas = document.createElement("canvas");
var context = canvas.getContext("2d");
canvas.height = 727;
canvas.width = 490;

function photomosaic(image, size) {
  var TILE_WIDTH = size == 100 ? image.width : size < 2 ? 2 : size;
  var TILE_HEIGHT = size == 100 ? image.height : size < 2 ? 2 : size;

  TILE_HEIGHT = parseInt(TILE_HEIGHT, 10);
  TILE_WIDTH = parseInt(TILE_WIDTH, 10);

  var tileWidth = TILE_WIDTH;
  var tileHeight = TILE_HEIGHT;

  var numTileRows = image.width / tileWidth;
  var numTileCols = image.height / tileHeight;

  var imageCanvas = document.createElement("canvas");
  var imageCanvasContext = canvas.getContext("2d");
  imageCanvas.height = image.height;
  imageCanvas.width = image.width;
  imageCanvasContext.drawImage(image, 0, 0);

  function averageColor(row, column) {
    var blockSize = 1,
      data,
      cordX = row * TILE_WIDTH,
      cordY = column * TILE_HEIGHT,
      i = -4,
      length,
      rgb = {
        r: 0,
        g: 0,
        b: 0,
      },
      count = 0;

    try {
      data = imageCanvasContext.getImageData(
        cordX,
        cordY,
        cordX + TILE_WIDTH > image.width ? image.width - cordX : TILE_WIDTH,
        cordY + TILE_HEIGHT > image.height ? image.height - cordY : TILE_HEIGHT
      );
    } catch (e) {
      console.log(e)
      return rgb;
    }

    length = data.data.length;

    while ((i += blockSize * 4) < length) {
      ++count;
      rgb.r += data.data[i];
      rgb.g += data.data[i + 1];
      rgb.b += data.data[i + 2];
    }

    rgb.r = ~~(rgb.r / count);
    rgb.g = ~~(rgb.g / count);
    rgb.b = ~~(rgb.b / count);

    return rgb;
  }

  for (var r = 0; r < numTileRows; r++) {
    for (var c = 0; c < numTileCols; c++) {
      // Set the pixel values for each tile
      var rgb = averageColor(r, c);
      console.log(rgb)
      var trueRow = r * tileHeight;
      var trueCol = c * tileWidth;

      var img = asingImage(rgbToLong(rgb));
      imageCanvasContext.drawImage(
        img,
        trueRow,
        trueCol,
        tileWidth,
        tileHeight
      );
    }
  }

  return canvas;
}

function create(size) {
  var image = document.getElementById("image");
  var canvas = photomosaic(image, size);
  if (document.getElementById("output").childElementCount > 0) {
    deleteAllChilds();
    document.getElementById("output").appendChild(canvas);
  } else {
    document.getElementById("output").appendChild(canvas);
  }
}

function deleteAllChilds() {
  const myNode = document.getElementById("output");
  while (myNode.lastElementChild) {
    myNode.removeChild(myNode.lastElementChild);
  }
}

function rgbToLong(rgb) {
  return rgb.b * 65536 + rgb.g * 256 + rgb.r;
}

function updateSlider(slideAmount) {
  create(slideAmount);
}

function asingImage(rgbLong) {
  var value = Math.floor(rgbLong / (16777215 / images.length));
  value = value == images.length ? images.length - 1 : value;
  if (value == 1) {
    console.log(rgbLong);
  }
  console.log(value, rgbLong, images.length)
  var img = new Image();
  img.src = `${images[value].data}`;
  return img;
}
